def TamañoEmpresa(start, end, nombre):
    if start <= 104:
        for empresa in tabla['tabla1']:
            if start <= int(empresa['No']) <= end:
                empresa['Municipio'] = nombre
            elif int(empresa['No']) > end:
                break
        with open('BDtabla.json', 'w') as archivo:
            json.dump(tabla, archivo)
    else:
        for empresa in tabla['tabla2']:
            if start <= int(empresa['No']) <= end:
                empresa['Municipio'] = nombre
            elif int(empresa['No']) > end:
                break
        with open('BDtabla.json', 'w') as archivo:
            json.dump(tabla, archivo)
                
    
    
